import { FormGroup } from '@material-ui/core';
import React from 'react';
import logo from '../../logos/Group 1329.png';

const RegisterForm = () => {
    return (
        <div>
            <div>
                <img src={logo} alt="" />
            </div>
            <form action="">
                <FormGroup style={{
                    width: '500px', margin: 'auto', padding: '10px 30px',
                    border: '1px solid lightgray', borderRadius: '5px'
                }}>
                    <h3>Register as a Volunteer</h3>
                    <input type="text" placeholder="Full Name" required />
                    <input type="text" placeholder="Username or Email" required />
                    <input type="text" placeholder="Date" required />
                    <input type="text" placeholder="Description" required />
                    <input type="text" placeholder="Organize books at the library" required />
                    <input type="submit" value="Registration " required />
                </FormGroup>
            </form>
        </div>
    );
};

export default RegisterForm;
